import React, { useState, useEffect } from 'react';

export default function Profile(props) {
    const [name, setName] = useState('');
    const [email, setEmail] = useState('');
    const [path1, setPath1] = useState([]);
    const [path2, setPath2] = useState([]);

    useEffect(() => {
        const fetchUserData = async () => {
            try {
                const response = await fetch(`http://localhost:5500/info?username=${props.user}`);
                if (!response.ok) {
                    throw new Error('Failed to fetch user data');
                }
                const data = await response.json();
                setName(data.name);
                setEmail(data.email);
                setPath1(data.path1 || []);
                setPath2(data.path2 || []);
            } catch (error) {
                console.error('Error fetching user data:', error);
            }
        };
        fetchUserData();
    }, [props.user]);

    return (
        <div className="container mt-5">
            <div className="row">
                <div className="col-md-4">
                    <div className="card profile-card">
                        <div className="card-body">
                            <h3 className="card-title">{name.toUpperCase()}</h3>
                            <p className="card-text">{email}</p>
                            <button className='btn btn-dark' onClick={props.loggedout}>Log Out</button>
                        </div>
                    </div>
                </div>
                <div className="col-md-8">
                    <div className="card">
                        <div className="card-body">
                            <h4 className="card-title">Profile Information</h4>
                            <ul className="list-group list-group-flush">
                                <li className="list-group-item"><strong>Name:</strong> {name}</li>
                                <li className="list-group-item"><strong>Email:</strong> {email}</li>
                            </ul>
                        </div>
                    </div>
                    <div className="card mt-3">
                        <div className="card-body">
                            <h4 className="card-title">StyleTransfer Activity</h4>
                            <div className="image-gallery">
                                {path1.map((path, index) => (
                                    <img key={index} src={`http://localhost:5500/${path}`} alt="" className="gallery-image" />
                                ))}
                            </div>
                        </div>
                    </div>
                    <div className="card mt-3">
                        <div className="card-body">
                            <h4 className="card-title">DeepDream Activity</h4>
                            <div className="image-gallery">
                                {path2.map((path, index) => (
                                    <img key={index} src={`http://localhost:5500/${path}`} alt="" className="gallery-image" />
                                ))}
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}
